kalimat:
Setiap kumpulan data pribadi harus ditentukan oleh data subjek dan data controller menggunakan tanda tangan digital dalam buku besar yang didistribusikan;
Kebijakan Penggunaan Data harus ditetapkan dengan jelas dan dicatat dalam buku besar yang didistribusikan;
Aktivitas data harus dicatat dalam buku besar yang didistribusikan.
